      SELECT * FROM tab2 (FORMAT parquet) cor0 WHERE NOT NULL BETWEEN 58 AND + col1 * + col2 + + CAST ( - col2 AS INTEGER ) / - 44 + col0 * 89;
  - name: tab2

outputs:
  - name: q6865.out
    data: |
